var lazyInterval;
var LazyLoad = (function() {
  "use strict";
  var fn, api;

  fn = {

    _lazyLoadImages: function() {

      var allLazyLoadElements = document.querySelectorAll(".lazy-load");

      for(var i=0; i < allLazyLoadElements.length; i++ ) {

        var eachLazyLoadElement = allLazyLoadElements[i];

        var checkIfImageAlreadyLoaded = (eachLazyLoadElement.getAttribute('data-bgsrc') || eachLazyLoadElement.getAttribute('data-src')) ? true : false;

        var hiddenInview = eachLazyLoadElement.classList.contains('hidden-inview') || false;

        if (checkIfImageAlreadyLoaded && fn._isElementVisible(eachLazyLoadElement, hiddenInview)) {
          fn._loadImage(eachLazyLoadElement, function (element) {
            element.classList.add('animated');
            element.classList.add('fadeIn');
            element.classList.remove('lazy-load');

            element.removeAttribute("data-src");
            element.removeAttribute("data-bgsrc");
          });
        }
      }
    },

    _isElementVisible: function(element, hiddenInview) {
      var rectValues = element.getBoundingClientRect(),
        viewportWidth = window.innerWidth || document.documentElement.clientWidth,
        viewportHeight = window.innerHeight || document.documentElement.clientHeight,
        detectCorner = function(x, y) {
          return document.elementFromPoint(x, y)
        };


      if (element.style.display === 'none' || rectValues.right < 0 || rectValues.bottom < 0 || rectValues.left > viewportWidth || rectValues.top > viewportHeight){
        return false;
      }


      if(!hiddenInview && element.style.display === '' && rectValues.left >= 0 && rectValues.top >= 0 && rectValues.right <= viewportWidth && rectValues.bottom <= viewportHeight){
        return true;
      }

      return (
        element.style.display === '' && (
          element.contains(detectCorner(rectValues.left, rectValues.top)) ||
          element.contains(detectCorner(rectValues.right, rectValues.top)) ||
          element.contains(detectCorner(rectValues.right, rectValues.bottom)) ||
          element.contains(detectCorner(rectValues.left, rectValues.bottom)
          )
        )
      );
    },

    _loadImage: function(element, callback) {
      var isBackgroundImage = element.getAttribute('data-bgsrc') ? true : false,
        tempImg = new Image(),
        src = isBackgroundImage ? element.getAttribute('data-bgsrc') : element.getAttribute('data-src');

      tempImg.onload = function() {
        if(isBackgroundImage){
          element.style.backgroundImage =  "url("+ src + ")";
        }else{
          element.src = src;
        }

        callback ? callback(element) : null;
      };
      tempImg.onerror = function() {
        if(isBackgroundImage){
          element.style.backgroundImage =  src;
        }else{
          element.src = src;
        }

        callback ? callback(element) : null;
      };
      tempImg.src = src;
    }
  };

  api = {
    lazyLoadImages: function() {
      return fn._lazyLoadImages.apply(this, arguments);
    },
    isElementVisible: function() {
      return fn._isElementVisible.apply(this, arguments);
    }
  };

  return api;
})();

(function (e) {
  e.fn.contactUs = function (t) {
    var form = e(this);

    var name = form.find('input[name=NAME]');
    var email = form.find('input[name=EMAIL]');
    var message_text = form.find('textarea[name=MESSAGE]');
    var contact_honeypot = form.find('textarea[name=contact-honeypot]');

    var message = $('#contact-status .message');
    var block = $('#contact-status .block-message');
    var note = $('#contact-status');

    // Reset and hide all messages on .keyup()
    $("#contactForm input, #contactForm textarea").keyup(function () {
      block.addClass("").removeClass("show-block-valid show-block-error");
      message.fadeOut();
    });

    $("#contactForm select").change(function () {
      block.addClass("").removeClass("show-block-valid show-block-error");
      message.fadeOut();
    });

    form.on("submit", function (t) {
      var valid = true;
      var error_message = '';

      t.preventDefault();
      var h = email.val();
      var valid_email = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
      var message_raw = message_text.val();
      var message_clean = message_raw.replace(/<[^>]*>?/gm, '');
      var has_link = new RegExp("([a-zA-Z0-9]+://)?([a-zA-Z0-9_]+:[a-zA-Z0-9_]+@)?([a-zA-Z0-9.-]+\\.[A-Za-z]{2,4})(:[0-9]+)?(/.*)?").test(message_raw);

      if (contact_honeypot.val() !== '' || message_raw !== message_clean || has_link) {
        valid = false;
        error_message = 'This Message was Detected as SPAM.';
      } else if (name.val() === '') {
        valid = false;
        error_message = 'Name cannot be blank.<br>Please check it and try again.';
        name.focus();
      } else if ( !valid_email.test(email.val())) {
        valid = false;
        error_message = 'Email Address is Invalid.<br>Please check it and try again.';
        email.focus();
      } else if (message_text.val() === '') {
        valid = false;
        error_message = 'Message cannot be blank.<br>Please check it and try again.';
        message_text.focus();
      }

      note.removeClass('alert alert-danger').hide();

      if (valid) {
        e.ajax({
          type: 'post',
          url: 'https://services.us14.list-manage.com/subscribe/post-json?u=158de27f713f7ed26783835cd&id=9d016f8b94&c=?',
          data: e(this).serialize(),
          cache: false,
          dataType: 'json',
          contentType: "application/json; charset=utf-8",
          error: function(err) {
            if (e.status == 404) {
              message.html('Service is not available at the moment.<br>Please check your internet connection or try again later.').fadeIn();
            } else {
              message.html('Oops. Looks like something went wrong.<br>Please try again later.').fadeIn();
            }

            note.addClass('alert alert-success').slideDown();
            CivilServices.trackEvent('Subscribe', 'AJAX Error', JSON.stringify(err));
          },
          success: function(data) {
            note.hide();
            if (data.result !== 'success') {
              message.html(data.msg).fadeIn();
              note.addClass('alert alert-danger').slideDown();

              CivilServices.trackEvent('Error', 'Contact Form', data.msg);

              if(data.msg.indexOf('is already subscribed') > -1){
                CivilServices.trackEvent('Subscribe', 'MailChimp Notice', 'Contacted Us Email Already Subscribed');
              } else {
                CivilServices.trackEvent('Subscribe', 'MailChimp Error', data.msg);
              }
            } else {
              form.trigger( 'reset' );

              message.html('<strong>Woo Hoo!</strong> We just sent you a confirmation email. Your message will be sent once you validate your email address.').fadeIn();
              note.addClass('alert alert-success').slideDown();

              CivilServices.trackEvent('Subscribe', 'MailChimp Success', 'User Contacted Us');

              setTimeout(function () { $('#contact-status').slideUp(); }, 5000);
            }
          }
        });
      } else {
        CivilServices.trackEvent('Error', 'Contact Form', error_message);
        message.html(error_message).fadeIn();
        note.addClass('alert alert-danger').slideDown();
      }
    })
  }

})(jQuery);

